                            $('#nomeDoPlano').val(nomeDoPlano);
                            $('#link').val(link);
                            $('#playtime').html(nomeDoPlano);
                        }
                    }
                });
                $('#formularioDeInscricao').submit(function (e) {
                    e.preventDefault();
                    var dadosDoFormulario = $(this).serialize();
                    $.ajax({
                        type: 'POST',
                        url: './Class/jajax.class.php',
                        data: dadosDoFormulario,
                        success: function (response) {
                            var resp = JSON.parse(response);
                            if (resp.status === 'success') {
                                window.location.href = resp.message;
                            } else {
                                alert('Erro: ' + resp.message);
                            }
                        },
                        error: function () {
                            alert('Erro ao enviar o formulário');
                        }
                    });
                });
            });
        </script>

